function login() {
  return (
    <div>
      <form method="post" action="index.html">
        <div className="box">
          <h1>Dashboard</h1>
          <input
            type="email"
            name="email"
            defaultValue="email"
            onfocus="field_focus(this, 'email');"
            onblur="field_blur(this, 'email');"
            className="email"
          />
          <input
            type="password"
            name="email"
            defaultValue="email"
            onfocus="field_focus(this, 'email');"
            onblur="field_blur(this, 'email');"
            className="email"
          />
          <a href="#">
            <div className="btn">Sign In</div>
          </a>{' '}
          {/* End Btn */}
          <a href="#">
            <div id="btn2">Sign Up</div>
          </a>{' '}
          {/* End Btn2 */}
        </div>{' '}
        {/* End Box */}
      </form>
      <p>
        Forgot your password? <u style={{color: '#f1c40f'}}>Click Here!</u>
      </p>
    </div>
  );
}

export default login;
